Send us a DM or email us at info@treatgallery.org for a full preview and additional information. We look forward to seeing you there! 🎨📸🍭

treat gallery has a proven track record of helping others through contemporary art. We partner with like-minded professionals and businesses with a shared goal of making the contemporary art field more honest and tangible. We participate in major art fairs, provide scholarships, portfolio reviews, and have a couple pop-up exhibitions a year, and with every project or pop-up show, we donate a percentage of proceeds to a various cause or non-profit.

